import * as React from "react";
import { AppBar, Toolbar, Typography, Box, Button, IconButton } from "@mui/material";
import ShoppingCartIcon from "@mui/icons-material/ShoppingCart";
import HomeIcon from "@mui/icons-material/Home"; // Venues Icon
import BrushIcon from "@mui/icons-material/Brush"; // Makeup Icon
import CameraAltIcon from "@mui/icons-material/CameraAlt"; // Photographers Icon
import MusicNoteIcon from "@mui/icons-material/MusicNote"; // Music Icon
import { Link } from "react-router-dom";

// Custom Hair Icon using inline SVG
const HairIcon = () => (
  <Box
    sx={{
      width: 24,
      height: 24,
      display: "inline-block",
      background: "url('data:image/svg+xml,%3Csvg xmlns=%22http://www.w3.org/2000/svg%22 fill=%22black%22 viewBox=%220 0 24 24%22%3E%3Cpath d=%22M12 2c4.97 0 9 4.03 9 9 0 4.97-4.03 9-9 9-4.97 0-9-4.03-9-9 0-4.97 4.03-9 9-9zm0 2C7.58 4 4 7.58 4 12s3.58 8 8 8 8-3.58 8-8-3.58-8-8-8zm0 2c3.31 0 6 2.69 6 6s-2.69 6-6 6-6-2.69-6-6 2.69-6 6-6z%22/%3E%3C/svg%3E')",
      backgroundSize: "contain",
      backgroundRepeat: "no-repeat",
    }}
  />
);

export default function NavigationBar() {
  return (
    <AppBar position="static" color="default" elevation={1} sx={{ backgroundColor: "#fff" }}>
      <Toolbar
        sx={{
          display: "flex",
          justifyContent: "space-between",
          alignItems: "center",
          paddingX: 4,
        }}
      >
        {/* Logo on the Left */}
        <Box
          component={Link}
          to="/new"
          sx={{
            textDecoration: "none",
            color: "inherit",
            display: "flex",
            alignItems: "center",
            gap: "10px",
          }}
        >
          <Box
            sx={{
              width: 40,
              height: 40,
              backgroundColor: "#ccc",
              borderRadius: "50%",
            }}
          />
          <Typography
            variant="h6"
            sx={{
              fontWeight: "bold",
              textTransform: "uppercase",
            }}
          >
            Logo Placeholder
          </Typography>
        </Box>

        {/* Navigation Links */}
        <Box
          sx={{
            display: "flex",
            gap: 3,
          }}
        >
          <Button
            component={Link}
            to="/venues"
            color="inherit"
            startIcon={<HomeIcon />}
            sx={{ textTransform: "uppercase", fontWeight: 500, fontSize: "14px" }}
          >
            Venues
          </Button>
          <Button
            component={Link}
            to="/hair"
            color="inherit"
            startIcon={<HairIcon />}
            sx={{ textTransform: "uppercase", fontWeight: 500, fontSize: "14px" }}
          >
            Hair
          </Button>
          <Button
            component={Link}
            to="/makeup"
            color="inherit"
            startIcon={<BrushIcon />}
            sx={{ textTransform: "uppercase", fontWeight: 500, fontSize: "14px" }}
          >
            Makeup
          </Button>
          <Button
            component={Link}
            to="/photographers"
            color="inherit"
            startIcon={<CameraAltIcon />}
            sx={{ textTransform: "uppercase", fontWeight: 500, fontSize: "14px" }}
          >
            Photographers
          </Button>
          <Button
            component={Link}
            to="/music"
            color="inherit"
            startIcon={<MusicNoteIcon />}
            sx={{ textTransform: "uppercase", fontWeight: 500, fontSize: "14px" }}
          >
            Music
          </Button>
        </Box>

        {/* Shopping Cart Icon on the Right */}
        <IconButton
          component={Link}
          to="/cart"
          color="inherit"
          sx={{
            padding: 1,
          }}
        >
          <ShoppingCartIcon />
        </IconButton>
      </Toolbar>
    </AppBar>
  );
}
